import React from 'react'

const Landing = () => {
    return (
        <div>
            <h1>Landing Page</h1>

            <a href="/workout/new">New Workout</a><br />

            <a href="/exercise">Exercise</a><br />
            <a href="/exercise/new">New Exercise</a><br />

            <a href="/users">All users</a>
        </div>
    )
}

export default Landing
